  return (
    <div className="bg-blue-500">

      <div className="flex flex-row justify-between">
      <NavLink to="/">
        <div>
            <img src="https://tse1.mm.bing.net/th?id=OIP.e2I94ZZAoZpk_50bvPGSVgHaCa&pid=Api&P=0&h=180" className="h-14 bg-blue-500"></img>
        </div>
      </NavLink>
          
          <div>
          <NavLink to="/">
            <p>Home</p>
          </NavLink>

          <NavLink to="/cart">
            <FaShoppingCart></FaShoppingCart>
          </NavLink>
          </div>

      </div>

    </div>
  )
};

export default Navbar;
